import React from 'react';
import { Link } from 'react-router-dom';
import siteLogo from '../images/logo-dark.png'
import toggleMenu from '../images/menu.png'
import { Nav, Navbar } from 'react-bootstrap'
class Header extends React.Component {
    constructor(props) {
        super(props);
        this.state = {};
    }
    render() {
        const { location } = this.props;
        return (
            <header className="sticky-top" id="stickytop">
                <div id="site-header">
                    <Link to="/">
                        <div className="site-logo">
                            <img src={siteLogo} alt="logo" />
                        </div>
                    </Link>
                    <div className='nav-toggle'>
                        <img src={toggleMenu} alt="nav-menu" />
                    </div>
                    <div className="slide-menu">
                        <Navbar bg="light" variant="light">
                            <Nav activeKey='/'>
                                <Nav.Link href="/">Home</Nav.Link>
                                <Nav.Link href="/one">One</Nav.Link>
                                <Nav.Link href="/two">Two</Nav.Link>
                            </Nav>
                        </Navbar>
                    </div>
                </div>
            </header>
        );
    }
}

Header.propTypes = {};

export default Header;
